const HUMAN = "you";
const COMPUTER = "ai";

function Square(props) {
    let squareIsFilled = "";
    if (props.value === "you") {
        squareIsFilled = "square-human-filled";
    } else  if (props.value === "ai") {
        squareIsFilled = "square-ai-filled";
    }
    return (
        <button className={`square ${squareIsFilled} `} onClick={props.onClick}>
            {props.value}
        </button>
    );
}

export default Square;
